import { Box } from "@mui/system";
import React from "react";
import StudentNavBar from "./StudentNavBar";

const StudentConsultations = () => {
  return (
    <>
      <StudentNavBar />
      <Box className="upcoming">
          <p>Upcoming Consultations</p>
      </Box>
    </>
  );
};

export default StudentConsultations;
